import React from 'react';
import Chip from '@material-ui/core/Chip';
function FilterChips(props) {
    return(
        <div>
            <Chip label="JavaScript" onClick={props.handleClick} />
            <Chip label="CSS" onClick={props.handleClick} />
            <Chip label="Python" onClick={props.handleClick} />
            <Chip label="HTML" onClick={props.handleClick} />
        </div>
    )
}
export default FilterChips;
